import React from "react";
import Product from "../components/Product";

export default function ProductScreen() {
  return (
    <div>
      <div className="row">
        /*col-2 significa que agarre 2 columnas de las 4 disponibles de la
        pantalla para mostrar la imagen del producto, col-1 significa que agarre
        1 columna de las 4 disponibles*/
        <div className="col-2">
          <img src={Product.image} alt={Product.name} />
        </div>
        <div className="col-1"></div>
        <div className="col-1"></div>
      </div>
    </div>
  );
}
